class Solution(object):
    def canReorderDoubled(self, A):
        """
        :type A: List[int]
        :rtype: bool
        """
        n = {}
        B=sorted(A,key=lambda x: abs(x))
        for i in A: n[i] = n.setdefault(i,0) + 1
        #print B, n
        for v in B:
            if v not in n: continue
            if 2*v not in n: return False

            if n[v] <= 1: del n[v]
            else: n[v] -= 1

            if 2*v not in n: return False

            if 2*v in n and n[2*v] <= 1: del n[v*2]
            else: n[2*v] -= 1
        return len(n) == 0

